import Ajv from "ajv";
import fs from "fs";
import path from "path";

// Load OpenAPI schema
const openApiPath = path.join(__dirname, "../../contracts/api.yaml");
const openApiContent = fs.readFileSync(openApiPath, "utf-8");

// Parse OpenAPI spec (simplified for testing - in production use a proper OpenAPI parser)
const ajv = new Ajv({
  allErrors: true,
  coerceTypes: true,
  strict: false,
  formats: {
    "date-time": true, // Enable date-time format validation
  },
});

describe("API Contract Compliance", () => {
  describe("Search API Contracts", () => {
    const searchResponseSchema = {
      type: "object",
      required: ["query", "results", "totalFound", "performance"],
      properties: {
        query: { type: "string" },
        results: {
          type: "array",
          items: {
            type: "object",
            required: ["id", "text", "meta", "cosineSimilarity", "rank"],
            properties: {
              id: { type: "string" },
              text: { type: "string" },
              meta: {
                type: "object",
                required: ["section", "contentType"],
                properties: {
